import React, { useEffect } from "react";
import styles from "./Men.module.css";
const Men = (props) => {
  props.setNavIndex(0);
  useEffect(() => {

    props.setUserColor("white");
  });
  return <div className={styles.men}></div>;
};
export default Men;
